import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div>
      <div>18 października 2023</div>
      <div>
        <h2>Ubezpieczenie auta</h2>
        <div>297.56zł</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
